        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        // backgroundColor:'black',
        width:'2.5rem',
        height:'2.5rem'
    }
    return(
        <footer>
            created by Johan Cortes
            <div style={style1}></div>
            <a href='https://co.linkedin.com/' target='_blank'></a>
        </footer>
    )
}
